            int[] lshape = lhs.shape.RemoveAt(lhs.ndim - 1);
            int[] rshape = rhs.shape.RemoveAt(rhs.ndim - 2);
            var retlen = lshape.Length + rshape.Length;
            var retarr = new int[retlen];

            lshape.CopyTo(retarr, 0);
            rshape.CopyTo(retarr, lhs.ndim - 1);
            var retShape = new Shape(retarr);
            var ret = new NDArray(np._FindCommonArrayType(lhs.typecode, rhs.typecode), retShape);

            //TODO! we can optimize GetOffset here
