                                lhs[#(join(", ", take(letters, #1).Insert(#1, "Slice.All")))]
                                * rhs[#(join(", ", skiptake(letters, #1, #101).Insert(#101-1, "Slice.All")))]).GetAtIndex(0),
                                    retShape.GetOffset(#(join(", ", retIndices))));
             
            %foreach range(0, #1+#101)%
            }
